import React from "react";

class Home extends React.Component {
    state = {
        googleLoginUrl: null,
    };

    componentDidMount() {
        fetch("/api/auth/google/url", {
            headers: new Headers({ accept: "application/json" }),
        })
            .then((response) => {
                if (response.ok) {
                    return response.json();
                }
                throw new Error("Something went wrong!");
            })
            .then((data) => this.setState({ googleLoginUrl: data.url }))
            .catch((error) => console.error(error));
        console.log(this.state.googleLoginUrl);
    }

    render() {
        const { googleLoginUrl } = this.state;
        return (
            <div className="container">
                <div className="row justify-content-center mt-5">
                    <div className="col-md-5 shadow p-3">
                        <div>
                            {googleLoginUrl && (
                                <>
                                    <a
                                        className="App-link btn btn-danger"
                                        href={googleLoginUrl}
                                    >
                                        Sign in with Google
                                    </a>
                                    {/* <div>{googleLoginUrl}</div> */}
                                </>
                            )}
                        </div>
                        <form id="login-form" className="form" action="" method="post">
                            <h3 className="text-center text-info">Login</h3>
                            <div className="form-group">
                                <label for="username" className="text-info">Username:</label><br/>
                                <input type="text" name="username" id="username" className="form-control" />
                            </div>
                            <div className="form-group">
                                <label for="password" className="text-info">Password:</label><br/>
                                <input type="text" name="password" id="password" className="form-control" />
                            </div>
                            <div className="form-group">
                                <input type="submit" name="submit" className="btn btn-info btn-md" value="submit" />
                            </div>
                            <div id="register-link" className="text-right">
                                <a href="#" className="text-info">Register here</a>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}
export default Home;
